import React from 'react';

const Contact = () => (
  <section className="contact">
    <h2>Contact</h2>
    <p>Email: helpfromharsh@gmail.com</p>
    <p>LinkedIn: <a href="https://www.linkedin.com/in/harshagrawal2503" target="_blank" rel="noopener noreferrer">harshagrawal2503</a></p>
  </section>
);

export default Contact;
